let B = false
input.buttonA.onEvent(ButtonEvent.Click, function () {
    A = !(A)
})
input.buttonB.onEvent(ButtonEvent.Click, function () {
    B = !(B)
})
forever(function () {
    if (A && false) {
        light.setAll(0xff0000)
    } else {
        light.clear()
    }
    pause(500)
})

